drop database if exists project2_dev;
create database project2_dev;

USE project2_dev;

CREATE TABLE Sessions
(
    sid varchar (255),
    userId varchar (255),
    expires datetime,
    data text,
    createdAt datetime,
    updatedAt datetime,
    primary key (sid)
);

CREATE TABLE usertrees
(
    id int not null
    auto_increment,
    latitude varchar
    (255),
    longitude varchar
    (255),
    tree_image_link varchar
    (255),
    date_planted date,
    name_of_tree varchar
    (255),
    users_tree_name varchar
    (255),
    treename varchar
    (255),
    treetype varchar
    (255),
    UserId int,
    createdAt TIMESTAMP default CURRENT_TIMESTAMP,
    updatedAt TIMESTAMP,
    primary key
    (id)
);

    CREATE TABLE users
    (
        id int not null
        auto_increment,
    firstName varchar
        (255),
    lastName varchar
        (255),
    dob date,
    city varchar
        (255),
    state varchar
        (255),
    country varchar
        (255),
    profile_image_link varchar
        (255),
    profile_text varchar
        (255),
    email varchar
        (255),
    password varchar
        (255),
    isAdmin boolean default 0,
    createdAt TIMESTAMP default CURRENT_TIMESTAMP,
    updatedAt TIMESTAMP,
    primary key
        (id)
);


